Object.Field:
SET ECHO OFF
SET TERMOUT OFF
DECLARE
A NUMBER(2,0);
B VARCHAR2(200);
TELEFONOS VARCHAR2(2000):='3222784515';  --VARIABLE...
CONTENIDO VARCHAR2(2000):='PRUEBA ODI';  --Contenido del mensaje...
VI NUMBER:=0;
CONTADOR NUMBER;
AUX VARCHAR2(4000);
AUX1 VARCHAR2(200);
K NUMBER:=1;
J NUMBER:=0;

BEGIN
contador := (length(TELEFONOS) - nvl(length( replace(TELEFONOS, ';', '')), 0)) + 1;
AUX:=TELEFONOS;
for i in 1..contador loop
     J:=INSTR(AUX,';')-1;
     if J<=0 then
     AUX1:=AUX;
     else
     AUX1:=SUBSTR(AUX,K,J); 
     AUX:=SUBSTR(AUX,J+2);    
     end if;
     execute immediate 'BEGIN INH_SMO.PRCINS_ENVIA(19,1,'||CHR(39)||'1002'||CHR(39)||','||CHR(39)||'57'||AUX1||CHR(39)||','||CHR(39)||CONTENIDO||CHR(39)||',2,55,0,0,0,0,0,:1,:2); END;'
     USING OUT A, OUT B;
END LOOP;
END;
